import React, { useState } from "react";

function HookArray() {
  const [todoLists, setTodoList] = useState([]);

  const todoListsHandler = () => {};

  return (
    <div>
      <input type="text" value={todoLists} />
      <button onClick={todoListsHandler}>Add Todo</button>
      <h1 key={todoLists.id}> {todoLists.value}</h1>
    </div>
  );
}

export default HookArray;
